import styled from "styled-components"

const Footer = styled.div`
    width:100%;
    flex-direction:column;
    display:flex;
    height:270px;
    color:white;
    background-color:#214142;
    justify-content:center;
    align-items:center;
    text-align:center;
    .icons{
        display:flex;
        flex-direction:row;
        a{
            height:60px;
        }
    }
    .description{
        font-size:0.8em;
    }
`
export default Footer
